import React, { Component } from 'react';
import Connector from '../images/connector.png';

class About extends Component {
  render() {
    return (
      <section id='about' className='about'>
        <div className='text-container'>
          <h4>
            Hi There! I'm <span className='highlight'>Michael</span>
          </h4>
          <br />
          <p>
            I am a self taught full-stack web developer from Fort Lauderdale,
            FL. I have been coding for over 3 years. I am passionate about all
            aspects of technology. However, web development is my favorite.
          </p>
          <p>
            let <span className='highlight'>skills</span> = [{' '}
            <span className='myskills'>
              'HTML', 'CSS', 'JAVASCRIPT', 'PHP', 'REACT', 'DJANGO', 'MYSQL',
              'MONGODB'
            </span>{' '}
            ]
          </p>
          <p>
            Take a look at my{' '}
            <span className='highlight'>
              <a
                className='highlight'
                href={Connector}
                download='connector.png'
              >
                Resume
              </a>
            </span>{' '}
            and my
            <span className='highlight'>
              {' '}
              <a className='highlight' href='https://github.com/michaelliriano'>
                Resume
              </a>{' '}
            </span>
            account. I'm available for freelance work. You can contact me at
            <span className='highlight'> michaelandrewliriano@gmail.com</span>
          </p>
          <h4>;</h4>
        </div>
      </section>
    );
  }
}

export default About;
